  const setState = (v: SetStateAction<T>) => {
    const nextValue =
      typeof v === 'function'
        ? (v as (prevState: T) => T)(stateRef.current)
        : v;
    if (nextValue === stateRef.current) return;
    stateRef.current = nextValue;
    update();
    onChange?.(nextValue);
  };

  return [stateRef.current, setState] as const;
